import React from 'react';


const TimerCard = (props) => {


    return(
        
        <div>
            {props.times.map((time) => {
                return(
                    <div>
                    <h1>{time.day}</h1>
                   </div>
                )
            })}

        </div>
    )
}



export default TimerCard;
